import React, { FC } from 'react';
import styles from './EmployeeItem.module.scss';
import Employee from '../../../models/Employee';

interface EmployeeItemProps {
  employee: Employee[];
}

const EmployeeItem: FC<EmployeeItemProps> = ({employee}) => (

<div className="card border-primary mb-3">
  <div className="card-header">מספר עובד: {employee.id}</div>
  <div className="card-body text-primary">
    <h5 className="card-title">{employee.firstName + ' ' + employee.lastName}</h5>
    <h5 className="card-title">{employee.title}</h5>
    <h5 className="card-title">{employee.birthDate}</h5>
    <h6 className="card-text">{employee.city + ', ' + employee.country}</h6>
    <h6 className="card-text">{employee.imageName}</h6>
  </div>
</div>

);

export default EmployeeItem;
